description:
heap Trick at Budokan is a live album released by Cheap Trick in 1978 and their best-selling recording. It was ranked number 430 in Rolling Stone magazine's list of &quot;the 500 Greatest Albums of All Time&quot; in 2003.

An expanded version of the original album was released in 1998 as At Budokan: The Complete Concert, remastered and fully restored to include all the concert tracks left off the original album.

